export default function Enrolledcourse(){

    const enrolledCourses = [
        {course_name:"Doug Abacus", joined_date:"06/03/2000", end_date:"05/09/2000"}
    ]
    return(
        <div>
            <div style={{display:'flex', justifyContent:'center'}}>
                {enrolledCourses.map((course) => {
                    return <div style={{width:"300px", backgroundColor:'whitesmoke', padding:'20px 20px', margin:'30px 10px', fontSize:'22px'}}>
                        <div style={{margin:"10px 10px"}}><span>Course Name: </span>{course.course_name}</div>
                        <div><span>Joined Date: </span>{course.joined_date}</div>
                        <div><span>Course End Date: </span>{course.end_date}</div>
                    </div>
                })}
            </div>
        </div>
    )
}
